import CsvUpload from './CsvUpload'
import React, { useState, useEffect } from 'react'


const Entry = () => {
    const [myData, setMyData] = useState([]);

    useEffect(() => {

        console.log(myData)
    }, [myData])



    return(
        <div>
        Hi
        <CsvUpload setMyData = {setMyData}/>

        {myData.map(game => {
            <li>
                {game.Sport}
            </li>
        })}
        </div>
    )
}

export default Entry
